import React from 'react';
import classes from './Modal.module.css';

class Modal extends React.Component {
    render() {
        return (
            <div className={classes.BackDrop}>
                <div className={classes.Modal}>
                    {this.props.name}
                    {this.props.desc}
                </div>
            </div>
        )
    }
}

export default Modal;
